import React from 'react'
import Item from './item'

function Lista (props){

    return(
    <div className="list">
      {
        props.items.map(item => 
            <Item 
                key={item.id}
                id={item.id}
                rating={item.rating}
                title={item.title}
                image={item.image} />
          )
      }
    </div>
    );
}

export default Lista;
